url = config['config']['api_endpoint']


def test_jpg_encode_img():
    # url = self.url
    payload = json.dumps({
        "clientRefId": "test_jpg",
        "inputImage": ""
    })

    response_json = requests.request(
        "POST",
        url,
        data=payload,
        headers={'accept': 'application/json',
                 'Content-Type': 'application/json',
                 'Authorization': 'Basic NzQwNTEzNjI1NjI1OjlDMG5VWDNoTlQwRDBKSEhPV0dtdU54aWhrSVJDR3lH'
                 })
    jpg_encoded_api_response = response_json.json()
    req_id = jpg_encoded_api_response['ocrReqId']
    print("Test case: JPG file base64 encoded img url")
    print("Input request payload: ", payload)
    print("Client req id:", jpg_encoded_api_response['ocrReqId'])
    print("Base64 value output for JPG file:", jpg_encoded_api_response)
    conn = connection_to_sql()
    cursor = conn.cursor()
    query = "SELECT * FROM ocr.ocr_remittance where ocr_id=%s order by id desc"
    cursor.execute(query, (req_id,))
    result = cursor.fetchall()
    print("DB output:", result)
    cursor.close()
    assert jpg_encoded_api_response['statusCode'] == 200
    assert jpg_encoded_api_response['status'] == 'success'
    assert jpg_encoded_api_response['clientRefId'] == 'test_jpg'
    assert jpg_encoded_api_response['ocrReqId'] == req_id
    assert jpg_encoded_api_response['result'][0]['payment_reference'] == '20618'
    assert jpg_encoded_api_response['result'][0]['amount'] == '700.00'
    assert jpg_encoded_api_response['result'][0]['transfer_date'] == '09/01/2024'
    assert jpg_encoded_api_response['result'][0]['transfer_bank_name'] == 'kinabank'
    assert jpg_encoded_api_response['result'][0]['additional_reference'] == 'Member#1354042441'
    assert jpg_encoded_api_response['result'][0]['to_account'] == '20882217'
    assert jpg_encoded_api_response['result'][0]['recipient_name'] == 'NASFUND CONTRIBUTORS SAVINGS &'
    return
